import { ProSidebar, Menu, MenuItem, SubMenu } from "react-pro-sidebar";
import "react-pro-sidebar/dist/css/styles.css";
const Sidebar = () => {
  return (
    <div Style="">
      <ProSidebar style={{width:280}} >
        <Menu
          iconShape="square"
          Style="background-color:rgba(5, 163, 144);height: 100vh; color:white"
        >
          <div style={{textAlign:"center"}}>
            <h3>Hospital Management System</h3>
          </div>
          <hr style={{marginTop:27}}></hr>
          <MenuItem Style=""><h5>Dashboard</h5></MenuItem>
          <MenuItem Style=""><h5>Admin</h5></MenuItem>
          <MenuItem Style=""><h5>Doctor</h5></MenuItem>
          <MenuItem Style=""><h5>Receptionist</h5></MenuItem>
          <MenuItem Style=""><h5>Accountant</h5></MenuItem>

          {/* <SubMenu title="Components" Style="background-color: pink;" > first line
           <MenuItem Style="background-color: pink;">Component 1</MenuItem>
          <MenuItem Style="background-color: pink;">Component 2</MenuItem> 
        </SubMenu > */}
        </Menu>
      </ProSidebar>
    </div>
  );
};
export default Sidebar;
